import React, { useState, useEffect } from 'react';
import api from '../api';
import './Assets.css';

const Assets = () => {
  const [filters, setFilters] = useState({
    date: '',
    base: 'All Bases',
    type: 'All Types'
  });
  const [assets, setAssets] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchAssets = async () => {
      try {
        const res = await api.get('/assets');
        setAssets(res.data);
      } catch (err) {
        setError('Failed to load assets');
      } finally {
        setLoading(false);
      }
    };
    fetchAssets();
  }, []);

  const handleFilterChange = (e) => {
    const { name, value } = e.target;
    setFilters((prev) => ({ ...prev, [name]: value }));
  };

  const filteredAssets = assets.filter((asset) => {
    return (
      (filters.base === 'All Bases' || asset.base === filters.base) &&
      (filters.type === 'All Types' || asset.type === filters.type)
    );
  });

  if (loading) return <p className="main-content">Loading assets...</p>;
  if (error) return <p className="main-content">{error}</p>;

  return (
    <div className="main-content">
      <h1>Assets</h1>

      <div className="filter-container">
        <input
          type="date"
          name="date"
          value={filters.date}
          onChange={handleFilterChange}
          className="filter-input"
        />
        <select name="base" value={filters.base} onChange={handleFilterChange} className="filter-select">
          <option>All Bases</option>
          {/* Dynamically generate base options if needed */}
          <option>Base Alpha</option>
          <option>Base Bravo</option>
        </select>
        <select name="type" value={filters.type} onChange={handleFilterChange} className="filter-select">
          <option>All Types</option>
          <option>Vehicle</option>
          <option>Weapon</option>
          <option>Ammunition</option>
          <option>Equipment</option>
        </select>
      </div>

      <table className="asset-table">
        <thead>
          <tr>
            <th>Name</th>
            <th>Type</th>
            <th>Quantity</th>
            <th>Status</th>
            <th>Base</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {filteredAssets.map((asset) => (
            <tr key={asset._id}>
              <td>{asset.name}</td>
              <td>{asset.type}</td>
              <td>{asset.quantity}</td>
              <td>
                <span
                  className={
                    asset.status === 'In stock' ? 'status-instock' : 'status-assigned'
                  }
                >
                  {asset.status}
                </span>
              </td>
              <td>{asset.base}</td>
              <td className="action-buttons">
                <button className="edit-btn">Edit</button>
                <button className="delete-btn">Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Assets;
